    return (
        <MDBContainer>
            <MDBRow>
                <MDBCol md="6">
                    <form>
                        <p className="h5 text-center mb-4">Sign up</p>
                        <div className="grey-text">
                            <MDBInput fname="firstName" label="Your Firstname" icon="user" group type="text" validate error="wrong"
                                success="right" />
                            <MDBInput lname="lastName" label="Your Lastname" icon="user" group type="text" validate error="wrong"
                                success="right" />
                            <MDBInput email="email" label="Your email" icon="envelope" group type="email" validate error="wrong"
                                success="right" />
                            <MDBInput pass="password" label="Your password" icon="lock" group type="password" validate />
                        </div>
                        <div className="text-center">
                            <MDBBtn type="submit" color="primary">Register</MDBBtn>
                        </div>
                    </form>
                </MDBCol>
            </MDBRow>
        </MDBContainer>
    )
}
